  return (
    <nav className={styles.navbar}>
      <ul>
        <li className={styles.title}>myMoney</li>

    {!user && (
      <>
        <li><Link to="/login">Login</Link></li>
        <li><Link to="/signup">Signup</Link></li>
      </>
    )}



      {user && (
          <>
            <li>hello, {user.displayName}</li>
